        setIncre(Increm + 1);
        // console.log('clicked'+ Inrem++);
    };

    return (
        <div className='Main-div'>
            <div className='Center-div'>
            <h1> 0 </h1>
            <div className='btn-div'>
                <button onClick={Increment}>  </button>
                <button> Decrem </button>
            </div>
            </div>
        </div>
    )
}

export default Incremnet;
